import React from 'react';
import ReactFlow, { Handle } from 'react-flow-renderer';


const upload = [
  {
    id: '1',
    type: 'upload',
    position: { x: 100, y: 100 },
    data: { text: 'Upload' },
  },
];

const discharge = [
  {
    id: '2',
    type: 'upload',
    position: { x: 100, y: 100 },
    data: { text: 'Upload' },
  },
];

const uploadStyle = {
  background: '#9CA8B3',
  color: '#FFF',
  padding: 20,
};

const UploadComponent = ({ data }) => {
  return (
    <div style={uploadStyle}>
      <div>{data.text}</div>
      <Handle
        type="source"
        position="right"
        id="1"
        style={{ top: '70%', borderRadius: 0 }}
      />
    </div>
  );
};



const nodeTypes = {
  upload: UploadComponent,
};


const App = () => {
  return (
    <div style={{ height: 700 }}>
      <ReactFlow elements={upload} nodeTypes={nodeTypes} />
    </div>
  );
};

export default App;
